import {
  Home,
  Person,
  PersonOffOutlined,
  PersonOutline,
} from "@mui/icons-material";
import { Tabs, Tab } from "@mui/material";

const SideBar = () => {
  const value = 0;
  return (
    <Tabs orientation="vertical" value={value}>
      <Tab icon={<Home />} label="Accueil" iconPosition="start" />
      <Tab icon={<PersonOutline />} label="Profil" iconPosition="start" />
    </Tabs>
  );
};

export default SideBar;
